function() {
  if ({{query_utm_source}}) {
	// utm_source found in URL. Set in cooke and update
    // this variable.
    window.document.cookie = "utm_source={{query_utm_source}}; ; path=/";
    return {{query_utm_source}};
  } else {
    // No utm_source found in URL. Load from cookie 
  	return {{cookie_utm_source}};
  }
}

